import React from 'react';
import { Text, View } from 'react-native';
import FormTextInput from '../../components/input/FormTextInput';

const AccountFormScreen = () => {
    return (
        <View>
            <FormTextInput label='First Name' placeholder='First Name' />
            <FormTextInput label='Last Name' placeholder='Last Name' />
            <FormTextInput label='Business Name' placeholder='Business Name' />
            <FormTextInput label='Contact Number' placeholder='Contact Number' />
            <FormTextInput label='Address' placeholder='Address' />
        </View>
    );
}

export default AccountFormScreen;
